import React from "react";
import './style.css'
class Spinner extends React.Component {
    constructor() {
        super()
    }
    spinner1() {
        <div className="loader">Loading...</div>
    }
    render() {
        return (
            <div>
                {spinner1()}
            </div>
        )

    }
}

export default Spinner
